const DiaryHistory = ({ data }) => {
  console.log(data);

  // This is a functional component within a functional component
  const List = () => {
    return (
      <ul>
        {data.map((d) => {
          return (
            <li className="text-sm">
              {d.summary} ({d.currentDate})
            </li>
          );
        })}
      </ul>
    );
  };
  return (
    <div className="basis-1/5 border border-blue-500 p-4">Diary History</div>
  );
};

export default DiaryHistory;
